void SceneComponent::sliderValueChanged (Slider* sliderThatWasMoved)
{
    //[UsersliderValueChanged_Pre]
    //[/UsersliderValueChanged_Pre]

    if (sliderThatWasMoved == slider1)
    {
        //[UserSliderCode_slider1] -- add your slider handling code here..

         // create and send an OSC message with an address and a float value:
       oscSender.send ((textEditorPrefix->getText() + textEditorMsg1->getText()), (int) slider1->getValue());
        //[/UserSliderCode_slider1]
    }
    else if (sliderThatWasMoved == slider2)
    {
        //[UserSliderCode_slider2] -- add your slider handling code here..
       oscSender.send ((textEditorPrefix->getText() + textEditorMsg2->getText()), (int) slider2->getValue());
        //[/UserSliderCode_slider2]
    }
    else if (sliderThatWasMoved == slider3)
    {
        //[UserSliderCode_slider3] -- add your slider handling code here..
       oscSender.send ((textEditorPrefix->getText() + textEditorMsg3->getText()), (int) slider3->getValue());
        //[/UserSliderCode_slider3]
    }
    else if (sliderThatWasMoved == slider4)
    {
        //[UserSliderCode_slider4] -- add your slider handling code here..
       oscSender.send ((textEditorPrefix->getText() + textEditorMsg4->getText()), (int) slider4->getValue());
        //[/UserSliderCode_slider4]
    }

    //[UsersliderValueChanged_Post]
    //[/UsersliderValueChanged_Post]
}

void SceneComponent::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == textButtonConnect)
    {
        //[UserButtonCode_textButtonConnect] -- add your button handler code here..
        if (! oscSender.connect (textEditorIP->getText(), textEditorPort->getText().getIntValue()))
            showConnectionErrorMessage ("Error: could not connect");
        //[/UserButtonCode_textButtonConnect]
    }
    else if (buttonThatWasClicked == textButtonSave)
    {
        //[UserButtonCode_textButtonSave] -- add your button handler code here..
        PropertiesFile* props = appProperties.getUserSettings();

        props->setValue("slider1", slider1->getValue());
        props->setValue("slider2", slider2->getValue());
        props->setValue("slider3", slider3->getValue());
        props->setValue("slider4", slider4->getValue());

        props->setValue("msg1", textEditorMsg1->getText());
        props->setValue("msg2", textEditorMsg2->getText());
        props->setValue("msg3", textEditorMsg3->getText());
        props->setValue("msg4", textEditorMsg4->getText());

        props->setValue("prefix", textEditorPrefix->getText());
        props->setValue("ip", textEditorIP->getText());
        props->setValue("port", textEditorPort->getText());

        props->save();
        //[/UserButtonCode_textButtonSave]
    }
    else if (buttonThatWasClicked == textButtonReset)
    {
        //[UserButtonCode_textButtonReset] -- add your button handler code here..
        textEditorMsg1->setText ("/1", dontSendNotification);
        textEditorMsg2->setText ("/2", dontSendNotification);
        textEditorMsg3->setText ("/3", dontSendNotification);
        textEditorMsg4->setText ("/4", dontSendNotification);

        textEditorPrefix->setText ("/1/10000/1", dontSendNotification);

        textEditorIP->setText ("84.111.138.155", dontSendNotification);
        textEditorPort->setText ("8000", dontSendNotification);
        //[/UserButtonCode_textButtonReset]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}



